import { useState } from "react";
import constate from "constate";

const InAppFactory = () => {
  const [app, setAppID] = useState<any>("");
  const [appUser, setAppUser] = useState<string>("");
  const [appTime, setAppTime] = useState<any>("");
  const [amount, setAmount] = useState<any>("");
  const [appTransID, setAppTransID] = useState<any>("");
  const [embedData, setEmbedData] = useState<string>("");
  const [item, setItem] = useState<string>("");
  const [description, setDescription] = useState<string>("");
  const [mac, setMac] = useState<string>("");
  const [subAppUser, setSubAppUser] = useState<string>("");
  const [subAppID, setsubAppID] = useState<string>("");
  return {
    app,
    setAppID,
    appUser,
    setAppUser,
    appTime,
    setAppTime,
    amount, setAmount,
    appTransID, setAppTransID,
    embedData, setEmbedData,
    item, setItem,
    description, setDescription,
    mac, setMac,
    subAppUser, setSubAppUser,
    subAppID, setsubAppID,
  };
};

export const [AppStoreProvider, useFullPaymentStore] = constate(InAppFactory);
